        DB::statement("INSERT INTO `sub_descripcion_versions` (`id`, `panel_version_id`, `categoria`, `descripcion`, `created_at`, `updated_at`) VALUES
        (2, 2, 'Nuevo', 'Mejora en la Interfaz de Usuario (UI):\n\nRediseño de la interfaz para hacerla más intuitiva y atractiva.\nMejora de la navegación y la disposición de elementos en la página.\nOptimización para dispositivos móviles (diseño responsive).', '2023-10-30 17:09:49', '2023-10-30 17:09:49'),
        (3, 2, 'Nuevo', 'Mejora en la Experiencia del Usuario (UX):\n\nSimplificación del proceso de inicio de sesión.\nInclusión de notificaciones a tiempo real.\nPersonalización de la experiencia del usuario, como preferencias de tema(Modo Oscuro) o imagen de perfil .', '2023-10-30 17:09:49', '2023-10-30 17:09:49'),
        (4, 2, 'Nuevo', 'Rendimiento y Velocidad:\n\nOptimización del rendimiento del sitio para cargar más rápido.\nMinimización de solicitudes de servidor para mejorar la velocidad de respuesta.', '2023-10-30 17:09:49', '2023-10-30 17:09:49'),
        (5, 2, 'Nuevo', 'Gestión de Contenido:\n\nPermitir a los usuarios la carga de contenido propio (por ejemplo, imágenes o documentos).', '2023-10-30 17:09:49', '2023-10-30 17:09:49'),
        (6, 2, 'Nuevo', 'Estadísticas y Reportes:\n\nInclusión de herramientas de analítica web para rastrear el comportamiento de los usuarios.\nGeneración de informes y análisis para ayudar en la toma de decisiones', '2023-10-30 17:09:49', '2023-10-30 17:09:49'),
        (7, 2, 'Nuevo', 'Soporte Multiplataforma:\r\n\r\nAsegurar que el sistema sea compatible con varios navegadores y sistemas operativos.\r\nPruebas de compatibilidad en diferentes dispositivos y resoluciones de pantalla.', '2023-10-30 17:09:49', '2023-10-30 17:09:49')");
